import React, { useState, useEffect } from 'react'
import ReactMegaMenu from "react-mega-menu"
import { Navbar, NavDropdown, Nav, Button } from 'react-bootstrap'
import logo from '../components/images/hublogotempate.png'
import Home from '../components/Home'
const NavBarD = (props) =>{
  const styleConfig = {  
      containerProps:{style:{width:"100%"}},
      contentProps:{style:{width: "500px"}},
      // menuItemProps?: React.HTMLAttributes<HTMLLIElement>;
      // menuItemSelectedProps?: React.HTMLAttributes<HTMLLIElement>;
      // menuProps?: React.HTMLAttributes<HTMLUListElement>;
    // menuProps: {
    //   style: {
    //     border: "2px solid red",
    //     height: "20em",
    //     width: "10em",
    //     padding: "2px",
    //     margin: "0"
    //   }
    // }
    // contentProps: {
    //   style: {
    //     width: "10em",
    //     border: "2px solid yellow",
    //     padding: "2px"
    //   }
    // },
    // menuItemProps: {
    //   style: {
    //     border: "2px solid green",
    //     padding: "2px",
    //     height: "2em"
    //   }
    // },
    // menuItemSelectedProps: {
    //   style: {
    //     border: "2px solid purple",
    //     padding: "2px",
    //     height: "2em",
    //     backgroundColor: "grey"
    //   }
    // },
    // containerProps: {
    //   style: {
    //     border: "2px solid blue",
    //     padding: "2px"
    //   }
    // }
  }
    return(
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Navbar.Brand className='mr-3' href="/">
                <img className='mr-3' src={logo} width="75" height="75"/>
                The Cayman Hub
                </Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto font-weight-bold ">
                    <Nav.Link className='ml-5 text-white' href="/events">What's Happening Now</Nav.Link>
                    <Nav.Link className='ml-5 text-white' href="/writereview">Write a Review</Nav.Link>
                    <Nav.Link className='ml-5 text-white' href="/gossip">Gossip</Nav.Link>
                    <Nav.Link className='ml-5 text-white' href="/requestaddition">Request an Addition</Nav.Link>
                </Nav>

                <ReactMegaMenu  
                    tolerance={100}      // optional, defaults to 100
                    direction={"LEFT"}  // optional, defaults to "RIGHT", takes in "RIGHT" || "LEFT"
                    styleConfig= {{ 
                      containerProps:{style:{width:"100%"}},
                      contentProps:{style:{width: "500px"}},
                    }}
                    // defaults to an empty object. not recommended to be left blank.
                    // onExit={()=>{...}}  // a function to be called when a mouse leaves the container
                    data={[
                        {
                            label: 'string',            // label to be shown on for each menuItem
                            key: 'string',     // a key id
                            items: <a href='reviews'>Reviews</a> // a react node to be presented as content
                          },
                        {
                            label: 'string',           // label to be shown on for each menuItem
                            key: 'string',     // a key id
                            items: 'and another'   // a react node to be presented as content
                        }
                    ]}>

                </ReactMegaMenu>

                <Nav>
                    <Button className='text-white' variant = 'outline-light' href="signin">Log in</Button>
                    {/* <Nav.Link className= 'text-white' eventKey={2} href="signup">Sign Up</Nav.Link> */}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
}

export default NavBarD;
